package com.interest.mm.borrowinginterest;/** * Created by Bobozai09 on 2018/6/15. */public class Calculation {    private  String calTime;    private  String  calValues;    private String calDays;    private  String calCom;    public Calculation(String calTime, String calValues, String calDays, String calCom) {        this.calTime = calTime;        this.calValues = calValues;        this.calDays = calDays;        this.calCom = calCom;    }    public String getCalTime() {        return calTime;    }    public void setCalTime(String calTime) {        this.calTime = calTime;    }    public String getCalValues() {        return calValues;    }    public void setCalValues(String calValues) {        this.calValues = calValues;    }    public String getCalDays() {        return calDays;    }    public void setCalDays(String calDays) {        this.calDays = calDays;    }    public String getCalCom() {        return calCom;    }    public void setCalCom(String calCom) {        this.calCom = calCom;    }}